import { useState } from "react";
import * as S from "../styles/Register.style";

function Register() {
  const [registerForm, setRegisterForm] = useState({})
  const getRegisterData = (e) => {
    setRegisterForm({
      ...registerForm,
      [e.name]: e.target.value
    })
    console.log(registerForm)
  }
  return (
    <S.Container>
      <S.RegisterWindow>
        프로필을 등록해주세요<br />
        <div>
          이름: <S.RegisterInput onChange={getRegisterData}/><br />
          나이: <S.RegisterInput onChange={getRegisterData}/><br />
          성별: <S.RegisterInput onChange={getRegisterData}/><br />
          키: <S.RegisterInput onChange={getRegisterData}/><br />
          몸무게: <S.RegisterInput onChange={getRegisterData}/><br />
        </div>
      </S.RegisterWindow>
    </S.Container>
  )
}

export default Register;
